import { Handle } from 'reactflow';

export const BaseNode = ({ id, label, children, handles = [] }) => {
  return (
    <div style={{ 
      minWidth: '170px', 
      padding: '12px', 
      border: '2px solid #6366f1', 
      borderRadius: '10px', 
      background: '#fff',
      boxShadow: '0 4px 6px rgba(0,0,0,0.1)'
    }}>
      <div style={{ fontWeight: 'bold', fontSize: '12px', color: '#4f46e5', marginBottom: '8px', borderBottom: '1px solid #eee' }}>
        {label}
      </div>
      <div style={{ display: 'flex', flexDirection: 'column', gap: '8px' }}>
        {children}
      </div>
      {handles.map((h, i) => (
        <Handle key={i} type={h.type} position={h.position} id={`${id}-${h.id}`} style={{ background: '#6366f1', ...h.style }} />
      ))}
    </div>
  );
};
